import React from "react";

const Navbar = () => {
  return(
    <div className="nav">
      <div className="logo">

      </div>

      <ul>
        <li>
          <a href="">Home</a>
        </li>
        <li>
          <a href="">About</a>
        </li>
        <li>
          <a href="">Features</a>
        </li>
      </ul>
    </div>
  )
};

export default Navbar;
